import React from "react";
import { Dimensions } from "react-native";
import { createDrawerNavigator } from "@react-navigation/drawer";
import { createAppContainer } from "react-navigation";
import { Entypo } from "@expo/vector-icons";

import HomePage from "../screens/homePage";
import UpcomingShows from "../screens/upcomingShows";
import GladiatorsLandingPage from "../screens/gladiatorsLandingPage";
import Store from "../screens/store";
import WaitList from "../screens/waitList";
import NavBar from "../components/NavBar";
import PlayVideoScreen from "../screens/playVideoScreen";
import HomeStack from "./homeStack";

const WIDTH = Dimensions.get("window").width;

const navigationOptions = () => {
  return {
    headerTitle: () => <NavBar />,
  };
};

const Drawer = createDrawerNavigator();

const DrawerNav = () => {
  return (
    <Drawer.Navigator
      screenOptions={{
        headerShown: false,
        swipeEdgeWidth: 0,
        drawerStyle: {
          width: WIDTH * 0.6,
        },
      }}
      // useLegacyImplementation={true}
    >
      <Drawer.Screen
        name="HomePage"
        component={HomePage}
        options={{
          navigationOptions: navigationOptions,
          title: "Home",
        }}
      />

      <Drawer.Screen
        name="UpcomingShows"
        component={UpcomingShows}
        options={{
          navigationOptions: navigationOptions,
          title: "Upcoming Shows",
        }}
      />

      <Drawer.Screen
        name="GladiatorsofSteel"
        component={GladiatorsLandingPage}
        options={{
          navigationOptions: navigationOptions,
          title: "Gladiators of Steel",
        }}
      />

      <Drawer.Screen
        name="Store"
        component={Store}
        options={{
          navigationOptions: navigationOptions,
          title: "Store",
        }}
      />

      <Drawer.Screen
        name="WaitList"
        component={WaitList}
        options={{
          navigationOptions: navigationOptions,
          title: "Waitlist",
        }}
      />

      <Drawer.Screen
        name="Video"
        component={PlayVideoScreen}
        options={{
          navigationOptions: navigationOptions,
          title: "Video",
        }}
      />
    </Drawer.Navigator>
  );
};

